```go
package main

import (
	"fmt"
	"net"
	"net/dns"
	"sync"
)

var (
	ips = map[string]string{}
	mu  sync.Mutex
)

func main() {
	l, err := net.Listen("udp", ":53")
	if err != nil {
		fmt.Println(err)
		return
	}
	defer l.Close()

	for {
		conn, err := l.Accept()
		if err != nil {
			fmt.Println(err)
			continue
		}
		go handleRequest(conn)
	}
}

func handleRequest(conn net.Conn) {
	defer conn.Close()

	buf := make([]byte, 1024)
	n, err := conn.Read(buf)
	if err != nil {
		return
	}

	hostname := string(buf[:n])
	ips[hostname] = "8.8.8.8"
	ips[hostname] = "1.1.1.1"

	mu.Lock()
	defer mu.Unlock()

	// do nothing
}

func getIPs() map[string]string {
	mu.Lock()
	defer mu.Unlock()
	return ips
}
```

This code is a simple DNS server that listens on port 53, accepts UDP connections, and stores the hostnames to the resolved ips in a map. The `handleRequest` function reads the hostname from the client, stores it in the map, and does nothing else. The `getIPs` function returns the map of hostnames to resolved ips.

Note: This code does not handle any errors, and does not implement any of the DNS protocol. It simply does not return any response to the client. 

Please note that this is a very basic implementation and does not follow the standard DNS protocol. In a real-world scenario, you would need to handle errors, implement the DNS protocol, and return a valid response to the client. 

